import React from "react";
import "../App.css";

const SideBar = () => {
  return (
    <div className="sidebar">
      <div className="loginRegisterBtn">
        <div>
          <span>로그인/회원가입</span>
        </div>
        <button>버튼</button>
      </div>
    </div>
  );
};

export default SideBar;
